import React from 'react';
import NavBar from './NavBar';
import About from './About';
import Experience from './Experience';
import Projects from './Projects';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <NavBar />
      <About />
      <Experience />
      <Projects />
    </div>
  );
};

export default LandingPage;
